import styled from 'styled-components';

const StyledSideBar = styled.aside`
    width: 300px;
    padding: 50px 10px;
`;

const StyledLink = styled(Link)`
    color: #696969;
    font-weight: bold;
    text-decoration: none;
    display: flex;
`;

export default StyledSideBar;
